import { Button, ButtonToolbar } from 'rsuite';
import React from 'react';

const Botao = ({mensagem, appearance}) => {


    return (
        <ButtonToolbar>
            <Button color="orange" appearance={appearance}>
                {mensagem}
            </Button>
        </ButtonToolbar>
    )
}

export default Botao;
